def power(a, b):
    """
    Calculate the value of 'a' to the power 'b'.
    """
    if b == 0:
        return 1  # Handling the case where any number to the power 0 is 1
    elif b == 1:
        return a  # Any number to the power 1 is itself
    else:
        result = 1
        while b > 0:
            if b % 2 == 1:  # odd number
                result *= a
            a *= a  # square the base
            b //= 2  # divide the exponent by 2
        return result

