def find_solution(a, b, n):
    """
    Finds integers x and y such that ax + by = n.
    Returns a tuple (x, y) if a solution exists, otherwise returns None.
    """
    # Check if the equation has a solution
    if (a * n) % b == 0 or (b * n) % a == 0:
        # Calculate x and y
        x = (n * a) // b
        y = (n * b) // a
        return (x, y)
    else:
        return None

