def find_min_diff(arr):
    # Initialize minimum difference to a large number
    min_diff = float('inf')

    # Iterate through the array to find the minimum difference
    for i in range(1, len(arr)):
        diff = abs(arr[i] - arr[i-1])
        if diff < min_diff:
            min_diff = diff

    return min_diff

