def count_reverse_pairs(string_list):
    count = 0
    for i in range(len(string_list)):
        reversed_string = string_list[i][::-1]
        if string_list[i] == reversed_string:
            count += 1
    return count

def create_new_tuple(string, list_elements):
    return (string, *list_elements)

